ble in the manner as mentioned<span class="_ _7"></span> in </div><div class="t m0 x5 h3 yd3 ff1 fs1 fc0 sc0 lsb ws14">the Key Facts Statement (KFS) above &amp; in the loan agreement to be executed. </div><div class="t m0 x5 h3 yd4 ff1 fs1 fc0 sc0 lsb ws14"> </div><div class="t m0 x5 h3 yd5 ff1 fs1 fc0 sc0 lsb ws14"> </div><div class="t m0 x5 h3 yd6 ff1 fs1 fc0 sc0 lsb ws14">The Borrower understands that the Lender has adopted risk-based pricing which is arrived by considering broad parameters like the </div><div class="t m0 x5 h3 yd7 ff1 fs1 fc0 sc0 lsb ws14">borrower&apos;s financial and credit risk profile. Hence the rates of Interest will be different for<span class="_ _0"></span> different categories of borro<span class="_ _7"></span>wers <span class="_ _0"></span>based on the </div><div class="t m0 x5 h3 yd8 ff1 fs1 fc0 sc0 lsb ws14">internal credit risk algorithms. </div><div class="t m0 x5 h3 yd9 ff1 fs1 fc0 sc0 lsb ws14">Please note that this communication should not be construed as giving rise to any obligation on the part of LSP/DLA/RE u<span class="_ _0"></span>nless<span class="_ _7"></span> the </div><div class="t m0 x5 h3 yda ff1 fs1 fc0 sc0 lsb ws14">loan agreement and the other documents relating to the above assistance are ex<span class="_ _0"></span>ecuted by you in such form and manner as may be<span class="_ _7"></span> </div><div class="t m0 x5 h3 ydb ff1 fs1 fc0 sc0 lsb ws14">required by LSP/DLA/RE. </div><div class="t m0 x5 h3 ydc ff1 fs1 fc0 sc0 lsb ws14"> </div><div class="t m0 x5 h3 ydd ff1 fs1 fc0 sc0 lsb ws14">We look forward to your availing of the sanctioned loan and assure you our best service always. </div><div class="t m0 x5 h3 yde ff1 fs1 fc0 sc0 lsb ws14"> </div><div class="t m0 x5 h3 ydf ff2 fs1 fc0 sc0 lsb ws14">TERMS &amp; CONDITIONS OF RECOVERY MECHANISM </div><div class="t m0 x5 h3 ye0 ff2 fs1 fc0 sc0 lsb ws14"> </div><div class="t m0 x5 h3 ye1 ff1 fs1 fc0 sc0 lsb ws14">The lender undertakes the recovery practices considering the following terms: </div><div class="t m0 x22 h4 ye2 ff8 fs2 fc0 sc0 lsb ws12">•<span class="ff1 ls3f ws14"> <span class="fs1 ls0 ws31">In<span class="lsb ws14">-house/Outsource Recovery </span></span></span></div><div class="t m0 x22 h4 ye3 ff8 fs2 fc0 sc0 lsb ws12">•<span class="ff1 ls3f ws14"> <span class="fs1 lsb">Digital Recovery </span></span></div><div class="t m0 x22 h4 ye4 ff8 fs2 fc0 sc0 lsb ws12">•<span class="ff1 ls3f ws14"> <span class="fs1 lsb">Reminder Communication </span></span></div><div class="t m0 x22 h4 ye5 ff8 fs2 fc0 sc0 lsb ws12">•<span class="ff1 ls3f ws14"> <span class="fs1 lsb">Field Collection (if required) </span></span></div><div class="t m0 x5 h3 ye6 ff1 fs1 fc0 sc0 lsb ws14">Where the Lender has failed to recover the money from the borrower it will rely upon the following legal recover<span class="_ _0"></span>y:<span class="_ _1"></span> </div><div class="t m0 x22 h4 ye7 ff8 fs2 fc0 sc0 lsb ws12">•<span class="ff1 ls3f ws14"> <span class="fs1 lsb">Legal Notice </span></span></div><div class="t m0 x22 h4 ye8 ff8 fs2 fc0 sc0 lsb ws12">•<span class="ff1 ls3f ws14"> <span class="fs1 lsb">Arbitration &amp; Conciliation </span></span></div><div class="t m0 x5 h3 ye9 ff1 fs1 fc0 sc0 lsb ws14">For the purpose of undertaking collection and recovery the Lender may either on its ow<span class="_ _0"></span>n or through the Lending service provid<span class="_ _1"></span>e<span class="_ _1"></span>r </div><div class="t m0 x5 h3 yea ff1 fs1 fc0 sc0 lsb ws14">(including its debt recovery agents etc.) undertake collection <span class="_ _0"></span>or recovery from the Borrower.<span class="_ _1"></span> </div><div class="t m0 x5 h33 yeb ff1 fs1 fc0 sc0 lsb ws14">For details of Lending Service Providers please refer to  <span class="ff3">List of LSPs</span> </div><div class="t m0 x5 h3 yec ff1 fs1 fc0 sc0 lsb ws14">All loans are to be paid to the lender only through the digital lending app or payme<span class="_ _0"></span>nt link generated and shared with the bor<span class="_ _1"></span>rowers<span class="_ _1"></span> by </div><div class="t m0 x5 h3 yed ff1 fs1 fc0 sc0 lsb ws14">the Lender. </div><div class="t m0 x5 h3 yee ff1 fs1 fc0 sc0 lsb ws14"> </div><div class="t m0 x5 h3 yef ff2 fs1 fc0 sc0 lsb ws14">Other Disclosures: </div><div class="t m0 x5 h3 yf0 ff2 fs1 fc0 sc0 lsb ws14"> </div><div class="t m0 x22 h4 yb5 ff8 fs2 fc0 sc0 lsb ws12">•<span class="ff1 ls3f ws14"> <span class="fs1 lsb">The lender will not be responsible for any payments made to <span class="_ _0"></span>any individual or entity in their bank accounts.<span class="_ _1"></span> </span></span></div><div class="t m0 x22 h4 yf1 ff8 fs2 fc0 sc0 lsb ws12">•<span class="ff1 ls3f ws14"> 
